import React from 'react';
import { WiDayCloudyGusts } from "react-icons/wi";

function Navbar() {

    return (
        <div className="sticky top-0 m-0 flex justify-between max-w-7xl mx-auto z-99 p-2 text-xl font-mono
         text-stone-200 items-center bg-header-primary xl:p-4 text-2xl 
         ">
            <div className='flex flex-row justify-between items-center'>
                <WiDayCloudyGusts size={60} className="animate-pulse ease-in-out" /><span className='font-semibold tracking-wider'>
                    &nbsp;Daily Weather App
                </span>
            </div>
            <p className="text-center items-center cursor-pointer tracking-tighter">
                {new Date().toDateString()}
            </p>
        </div>
    )
}

export default Navbar
